import React from 'react';
import Trade from './Trade';

//import { GlobalContext } from '../context/GlobalState';

const TradeList = props => {
  const { tradeList } = props;
  return (
    <>
      {tradeList.map(trade => (<Trade key={trade.id} trade={trade} />))}
    </>
  )
}

export default TradeList;
